import React, { Component } from "react";

import Header from "../components/Header/header";
import HeroSection from "../components/HeroSection/HeroSection2";
import PromoSection from "../components/PromoSection";
import AboutSection from "../components/AboutUs";
import FeatureSection from "../components/Features/Feature3";
// import FeatureSection1 from "../components/Features";
import DownloadSection from "../components/Download";
// import PromoSection from "../components/PromoSection/Promo2";
// import AboutSection from "../components/AboutUs/AboutUs2";
import FeatureSection2 from "../components/Features/Feature2";
// import VideoSection from "../components/Video";
// import PricingSection from "../components/Pricing";
import Testimonial from "../components/Testimonial";
import Screenshots from "../components/Screenshots";
// import FaqSection from "../components/Faq";
// import TeamMember from "../components/TeamMember";
import ContactSection from "../components/Contact";
// import TrustedCompany from "../components/TrustedCompany/TrustedCompany";
// import SubscribeSection from "../components/Subscribe";
import FooterSection from "../components/Footer";

class Theme extends Component {
  render() {
    return (
      <React.Fragment>
        <Header />
        <div className="main">
          <HeroSection />
          <PromoSection />
          <FeatureSection />
          <AboutSection />
          <FeatureSection2/>
          <DownloadSection />
      
          <Testimonial />
          <Screenshots />
          {/* <FaqSection /> */}
          {/* <TeamMember /> */}
          <ContactSection />
          {/* <TrustedCompany /> */}
        </div>
        {/* <SubscribeSection /> */}
        <FooterSection />
      </React.Fragment>
    );
  }
}

export default Theme;
